import React from 'react'
// Mount Nabvar.css
import './Navbar.css'
import logo from '../Assests/logo.png'
import cart_icon from '../Assests/cart_icon.png'

const Navbar = () => {
    return (
        <div className='navbar'>
            <div className='nav-logo'>
                <img src={logo} alt=''/>
            </div>

        </div>
    )
}

export default Navbar
